        super();
        this.state = {
            data : {"content" : "none"}
        }
        this.fetchData = this.fetchData.bind(this);
    }

    fetchData()
    {
        this.setState(
            {
                data : fetch("http://localhost:8000/current")
                    .then((res) => {
                        res.json()})
