    }

    componentDidMount() {
        this.fetchData();
        console.log(this.state.data);
    }

    render()
    {
        return(
            <section id={"weatherCard"}>
                <h1>Current Weather</h1>
                <img alt={"image"} src={cloud}/>
            </section>
        )
    }
}

export default Weather
